// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 < 0.9.0;

contract local{

mapping(address=>uint) contributors;

uint target;
uint deadline;
address manager;
uint raisedAmount;
uint minContribution;
uint noofContributors;




constructor(uint _deadline, uint _target, uint _minContribution )
{
    manager = msg.sender;
    deadline =_deadline;
    minContribution = _minContribution;
    target = _target;

}


function balanceinContract() public view returns(uint)
{
    return address(this).balance;
}

function sendEthertoContract() public payable  
{

  require(deadline>block.timestamp,"Sorry we have now stopped accepting funds");
  require(target<raisedAmount,"Sorry money has been already raised");
  require(msg.value>minContribution,"Sorry contribute more than Min contribution");
  if(contributors[msg.sender]==0)
  {
    noofContributors++;
  }  
    contributors[msg.sender]+=msg.value;
    raisedAmount+= msg.value;
 
}

//Now refunding money

function refunding() public 
{
    require(deadline<block.timestamp && raisedAmount<target);
    address payable user = payable(msg.sender);
    user.transfer(contributors[msg.sender]);
    contributors[msg.sender]=0;
}

//NOw voting

struct Request{

    address payable  recepient;
    uint value;
    string description;
    bool decision;
    uint noofVoters;
    mapping (address=> bool) voterschoice;



}
mapping (uint=>Request) public noofRequests;
uint requestnumber;

function createRequest(string memory _description, address payable _recepient, uint _value) public 
{
    require(msg.sender==manager);
    Request storage newRequest = noofRequests[requestnumber];
    requestnumber++;
    newRequest.description = _description;
    newRequest.value=_value;
    newRequest.recepient=_recepient;
    newRequest.noofVoters=0;
    newRequest.decision= false;

} 

function voteRequest(uint _numrequest) public   // yeh function pe click kiya na toh vote ho jata hai 
{
    require(contributors[msg.sender]>0,"Sorry you are not a contributor");
    Request storage  thisrequest = noofRequests[_numrequest];
    require(thisrequest.voterschoice[msg.sender]);
    thisrequest.voterschoice[msg.sender] = true;
    thisrequest.noofVoters++;

}










}

